import React from "react";

// Footer Component
function Footer() {
    return (
        <footer className="footer">
            <div>Made with ❤️️ by Alana Barrett-Frew and Felix Dunham &copy; 2023 Alana Barrett-Frew</div><a href="https://www.vecteezy.com/free-vector/camouflage">Camouflage Vectors by Vecteezy</a><a href="https://www.flaticon.com/free-icons/artillery" title="Artillery icons">Artillery icons created by AmethystDesign - Flaticon</a>
        </footer>
    );
}

export default Footer;
